import React from 'react';
import { BookDetails } from '../queries/getBooks';
import { StringLiteral } from 'typescript';
import { Table, TableContainer, Text, Thead } from '@chakra-ui/react';
import { ListBookDetail } from '../queries/getAllBooks';



const ListBookRow: React.FC<ListBookDetail> =({
handleClick,
key,
ID,
title,
author,
description,
price,
genre
}) => {
    return (
        <>
        <TableContainer>
        <Table>
            <Thead>Book: {ID}</Thead>
            <Text>{title}</Text>
            <Text>{description}</Text>
            <Text>{author}</Text>
            <Text>{price}</Text>
            <Text>{genre}</Text>
        </Table>
        </TableContainer>

        </>
    )

}


export default ListBookRow;
